    <title>üéÑ Flame Media ‚Äî –ù–æ–≤–æ—Ä—ñ—á–Ω–∏–π –†–æ–∑—ñ–≥—Ä–∞—à</title>
    <link href="https://fonts.googleapis.com/css2?family=Comfortaa:wght@400;600;700&family=Montserrat:wght@300;500;700&display=swap" rel="stylesheet">
    <style>
        :root {
            --flame-orange: #ff6b35;
            --flame-red: #e63946;
            --flame-yellow: #ffd23f;
            --gold: #fbbf24;
            --green: #10b981;
            --dark: #1a1a2e;
            --darker: #0f0f1a;
        }
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body {
            font-family: 'Montserrat', sans-serif;
            min-height: 100vh;
            background: linear-gradient(135deg, #0f0f1a 0%, #1a1a2e 50%, #16213e 100%);
            color: white;
        }
        .container { max-width: 1400px; margin: 0 auto; padding: 1.5rem; }
        .header { text-align: center; margin-bottom: 2rem; }
        .brand {
            display: inline-flex; align-items: center; gap: 0.5rem;
            background: linear-gradient(135deg, var(--flame-orange), var(--flame-red));
            padding: 0.5rem 1.5rem; border-radius: 50px; font-weight: 600; margin-bottom: 0.5rem;
        }
        .header h1 {
            font-family: 'Comfortaa', cursive; font-size: 2.5rem;
            background: linear-gradient(135deg, var(--flame-yellow), var(--flame-orange));
            -webkit-background-clip: text; -webkit-text-fill-color: transparent;
        }
        .header .subtitle { color: rgba(255,255,255,0.6); margin-top: 0.5rem; }
        .board {
            display: flex; justify-content: center; flex-wrap: wrap;
            gap: 1.5rem; max-width: 700px; margin: 0 auto;
        }
        .ball {
            width: 100px; height: 100px; border-radius: 50%;
            background: linear-gradient(145deg, #2a2a4a, #1a1a2e);
            border: 3px solid rgba(255,255,255,0.1);
            display: flex; align-items: center; justify-content: center;
            font-family: 'Comfortaa', cursive; font-size: 2.2rem; font-weight: 700;
            cursor: pointer; transition: all 0.3s ease; position: relative;
            box-shadow: 0 4px 15px rgba(0,0,0,0.3);
        }
        .ball:hover {
            transform: scale(1.1); border-color: var(--flame-orange);
            box-shadow: 0 0 30px rgba(255, 107, 53, 0.4);
        }
        .ball.used {
            background: linear-gradient(145deg, #10b981, #059669);
            border-color: #34d399; 
            cursor: default;
            color: white;
            text-shadow: 0 2px 4px rgba(0,0,0,0.3);
            box-shadow: 0 0 20px rgba(16, 185, 129, 0.5), inset 0 2px 10px rgba(255,255,255,0.2);
        }
        .ball.used::after {
            content: '‚úì'; position: absolute; font-size: 1rem; color: white;
            bottom: -3px; right: -3px; background: #059669; border-radius: 50%;
            width: 26px; height: 26px; display: flex; align-items: center; justify-content: center;
            border: 2px solid #34d399;
            font-weight: bold;
        }
        .ball.used:hover { transform: none; box-shadow: 0 0 20px rgba(16, 185, 129, 0.5); }
        .modal-overlay {
            position: fixed; top: 0; left: 0; width: 100%; height: 100%;
            background: rgba(0,0,0,0.95); display: none;
            align-items: center; justify-content: center; z-index: 1000; padding: 1rem;
        }
        .modal-overlay.show { display: flex; animation: fadeIn 0.3s ease; }
        @keyframes fadeIn { from { opacity: 0; } to { opacity: 1; } }
        .modal {
            background: linear-gradient(135deg, #1a1a2e, #16213e);
            border: 2px solid var(--flame-orange); border-radius: 24px;
            padding: 2rem; max-width: 1100px; width: 100%; max-height: 90vh; overflow-y: auto;
        }
        .modal-header { text-align: center; margin-bottom: 1.5rem; }
        .modal-header h2 { font-family: 'Comfortaa', cursive; font-size: 1.8rem; color: var(--flame-yellow); }
        .modal-header .ball-number {
            display: inline-flex; align-items: center; justify-content: center;
            width: 60px; height: 60px;
            background: linear-gradient(135deg, var(--flame-orange), var(--flame-red));
            border-radius: 50%; font-family: 'Comfortaa', cursive;
            font-size: 1.5rem; font-weight: 700; margin-bottom: 1rem;
        }
        .gifts-grid {
            display: grid; grid-template-columns: repeat(auto-fit, minmax(180px, 1fr)); gap: 1rem;
        }
        .gift-card {
            background: rgba(255,255,255,0.05); border: 2px solid rgba(255,255,255,0.1);
            border-radius: 16px; padding: 1rem; text-align: center;
            cursor: pointer; transition: all 0.3s ease; position: relative;
        }
        .gift-card:hover {
            border-color: var(--flame-orange); background: rgba(255,255,255,0.1);
            transform: translateY(-5px); box-shadow: 0 10px 30px rgba(255, 107, 53, 0.3);
        }
        .gift-card.selected {
            border-color: var(--green); background: rgba(16, 185, 129, 0.2);
            box-shadow: 0 10px 30px rgba(16, 185, 129, 0.3);
        }
        .gift-card.taken { opacity: 0.3; pointer-events: none; filter: grayscale(1); }
        .gift-card.taken::before {
            content: '–û–ë–†–ê–ù–û'; position: absolute; top: 50%; left: 50%;
            transform: translate(-50%, -50%) rotate(-10deg);
            background: var(--flame-red); padding: 0.3rem 1rem; border-radius: 8px;
            font-weight: 700; font-size: 0.8rem; z-index: 10;
        }
        .gift-image {
            width: 100%; height: 120px; object-fit: contain;
            background: white; border-radius: 12px; padding: 0.5rem; margin-bottom: 0.75rem;
        }
        .gift-name { font-size: 0.85rem; font-weight: 500; line-height: 1.3; color: rgba(255,255,255,0.9); }
        .modal-actions { display: flex; gap: 1rem; justify-content: center; margin-top: 1.5rem; flex-wrap: wrap; }
        .btn {
            padding: 0.75rem 2rem; border-radius: 50px; font-weight: 600;
            cursor: pointer; transition: all 0.3s ease; border: none; font-size: 1rem;
        }
        .btn-confirm {
            background: linear-gradient(135deg, var(--green), #059669);
            color: white; display: none;
        }
        .btn-confirm.show { display: block; }
        .btn-confirm:hover { transform: scale(1.05); box-shadow: 0 5px 20px rgba(16, 185, 129, 0.5); }
        .btn-cancel { background: rgba(255,255,255,0.1); color: white; }
        .btn-cancel:hover { background: rgba(255,255,255,0.2); }
        .btn-reset {
            position: fixed; bottom: 1.5rem; right: 1.5rem;
            background: rgba(230, 57, 70, 0.2); border: 2px solid var(--flame-red);
            color: white; padding: 0.75rem 1.5rem; border-radius: 50px;
            font-weight: 600; cursor: pointer; transition: all 0.3s ease;
            font-size: 0.9rem;
        }
        .btn-reset:hover {
            background: var(--flame-red);
            box-shadow: 0 5px 20px rgba(230, 57, 70, 0.5);
        }
        .success-overlay {
            position: fixed; top: 0; left: 0; width: 100%; height: 100%;
            background: rgba(0,0,0,0.95); display: none;
            align-items: center; justify-content: center; z-index: 2000; padding: 1rem;
        }
        .success-overlay.show { display: flex; animation: fadeIn 0.3s ease; }
        .success-content { text-align: center; max-width: 500px; }
        .success-content h2 {
            font-family: 'Comfortaa', cursive; font-size: 2.5rem;
            color: var(--flame-yellow); margin-bottom: 1.5rem;
        }
        .success-gift-image {
            width: 200px; height: 200px; object-fit: contain;
            background: white; border-radius: 20px; padding: 1rem; margin-bottom: 1.5rem;
        }
        .success-gift-name { font-size: 1.2rem; margin-bottom: 2rem; color: rgba(255,255,255,0.9); }
        .confetti-container { position: fixed; top: 0; left: 0; width: 100%; height: 100%; pointer-events: none; z-index: 1999; overflow: hidden; }
        .confetti {
            position: absolute; width: 10px; height: 10px; top: -10px;
            animation: confettiFall 3s ease-out forwards;
        }
        @keyframes confettiFall {
            0% { transform: translateY(0) rotate(0deg); opacity: 1; }
            100% { transform: translateY(100vh) rotate(720deg); opacity: 0; }
        }
    </style>

        const TOTAL_BALLS = 6;
        const STORAGE_KEY = 'flamemedia_lottery_2025';

        let usedBalls = new Set();
        let currentBall = null;
        let selectedGiftId = null;

        function loadState() {
            try {
                const saved = localStorage.getItem(STORAGE_KEY);
                if (saved) {
                    const state = JSON.parse(saved);
                    usedBalls = new Set(state.usedBalls || []);
                    
                    if (state.takenGifts) {
                        for (const [categoryName, giftIds] of Object.entries(state.takenGifts)) {
                            if (CATEGORIES[categoryName]) {
                                CATEGORIES[categoryName].gifts.forEach(gift => {
                                    gift.taken = giftIds.includes(gift.id);
                                });
                            }
                        }
                    }
                }
            } catch (e) {
                console.error('–ü–æ–º–∏–ª–∫–∞ –∑–∞–≤–∞–Ω—Ç–∞–∂–µ–Ω–Ω—è —Å—Ç–∞–Ω—É:', e);
            }
        }

        function saveState() {
            try {
                const takenGifts = {};
                for (const [categoryName, category] of Object.entries(CATEGORIES)) {
                    takenGifts[categoryName] = category.gifts
                        .filter(g => g.taken)
                        .map(g => g.id);
                }
                
                const state = {
                    usedBalls: Array.from(usedBalls),
                    takenGifts: takenGifts
                };
                
                localStorage.setItem(STORAGE_KEY, JSON.stringify(state));
            } catch (e) {
                console.error('–ü–æ–º–∏–ª–∫–∞ –∑–±–µ—Ä–µ–∂–µ–Ω–Ω—è —Å—Ç–∞–Ω—É:', e);
            }
        }

        function getCategoryForBall(num) {
            for (const [name, cat] of Object.entries(CATEGORIES)) {
                if (cat.balls.includes(num)) return cat;
            }
            return null;
        }

        function renderBoard() {
            const board = document.getElementById('board');
            board.innerHTML = '';
            for (let i = 1; i <= TOTAL_BALLS; i++) {
                const ball = document.createElement('div');
                ball.className = 'ball' + (usedBalls.has(i) ? ' used' : '');
                ball.textContent = i;
                ball.onclick = () => openBall(i);
                board.appendChild(ball);
            }
        }

        function openBall(num) {
            if (usedBalls.has(num)) return;
            const category = getCategoryForBall(num);
            if (!category) { alert('–¶—è –∫–∞—Ç–µ–≥–æ—Ä—ñ—è —â–µ –Ω–µ –Ω–∞–ª–∞—à—Ç–æ–≤–∞–Ω–∞'); return; }
            currentBall = num;
            selectedGiftId = null;
            document.getElementById('modalBallNumber').textContent = num;
            renderGifts(category.gifts);
            document.getElementById('modalOverlay').classList.add('show');
            document.getElementById('btnConfirm').classList.remove('show');
        }

        function renderGifts(gifts) {
            const grid = document.getElementById('giftsGrid');
            grid.innerHTML = gifts.map(gift => `
                <div class="gift-card ${gift.taken ? 'taken' : ''} ${selectedGiftId === gift.id ? 'selected' : ''}"
                     onclick="selectGift('${gift.id}')">
                    <img class="gift-image" src="${gift.image}" alt="${gift.name}">
                    <div class="gift-name">${gift.name}</div>
                </div>
            `).join('');
        }

        function selectGift(giftId) {
            const category = getCategoryForBall(currentBall);
            const gift = category.gifts.find(g => g.id === giftId);
            if (gift.taken) return;
            selectedGiftId = giftId;
            renderGifts(category.gifts);
            document.getElementById('btnConfirm').classList.add('show');
        }

        function confirmGift() {
            if (!selectedGiftId || !currentBall) return;
            const category = getCategoryForBall(currentBall);
            const gift = category.gifts.find(g => g.id === selectedGiftId);
            gift.taken = true;
            usedBalls.add(currentBall);
            
            saveState();
            
            document.getElementById('modalOverlay').classList.remove('show');
            document.getElementById('successImage').src = gift.image;
            document.getElementById('successGiftName').textContent = gift.name;
            document.getElementById('successOverlay').classList.add('show');
            createConfetti();
            renderBoard();
            currentBall = null;
            selectedGiftId = null;
        }

        function closeModal() {
            document.getElementById('modalOverlay').classList.remove('show');
            currentBall = null;
            selectedGiftId = null;
        }

        function closeSuccess() {
            document.getElementById('successOverlay').classList.remove('show');
        }

        function createConfetti() {
            const container = document.getElementById('confetti');
            container.innerHTML = '';
            const colors = ['#ff6b35', '#e63946', '#ffd23f', '#10b981', '#fbbf24', '#fff'];
            for (let i = 0; i < 150; i++) {
                const c = document.createElement('div');
                c.className = 'confetti';
                c.style.left = Math.random() * 100 + '%';
                c.style.backgroundColor = colors[Math.floor(Math.random() * colors.length)];
                c.style.animationDelay = (Math.random() * 0.8) + 's';
                if (Math.random() > 0.5) c.style.borderRadius = '50%';
                container.appendChild(c);
            }
            setTimeout(() => container.innerHTML = '', 4000);
        }

        function resetAll() {
            if (!confirm('‚ö†Ô∏è –í–∏ –≤–ø–µ–≤–Ω–µ–Ω—ñ, —â–æ —Ö–æ—á–µ—Ç–µ —Å–∫–∏–Ω—É—Ç–∏ –≤—Å—é –≥—Ä—É?\n\n–í—Å—ñ –æ–±—Ä–∞–Ω—ñ –ø–æ–¥–∞—Ä—É–Ω–∫–∏ —Ç–∞ –≤–∏–∫–æ—Ä–∏—Å—Ç–∞–Ω—ñ –∫—É–ª—å–∫–∏ –±—É–¥—É—Ç—å –æ—á–∏—â–µ–Ω—ñ!')) return;
            
            usedBalls = new Set();
            Object.values(CATEGORIES).forEach(cat => {
                cat.gifts.forEach(g => {
                    g.taken = false;
                });
            });
            currentBall = null;
            selectedGiftId = null;
            
            localStorage.removeItem(STORAGE_KEY);
            
            document.getElementById('modalOverlay').classList.remove('show');
